// Import Styled
import styled from 'styled-components';

export const TitleH5 = styled.text`
	color: #79828B;
    display: block;
    h5{
		font-weight: 500;
		font-size: 14px;
		letter-spacing: 1.5px;
		line-height: 15px;
		text-transform: uppercase;
		margin-bottom: 16px;
    }
`;
